CREATE TABLE journal (
  id bigint auto_increment,
  publication_date timestamp not null,
  authors varchar(255) ,
  title varchar(255) not null,
  publisher varchar(50),
  volume varchar(255),
  location varchar(255),
  primary key (id));
  
CREATE TABLE book (
  id bigint auto_increment,
  title varchar(50) not null,
  author varchar(50),
  publisher varchar(50),
  date timestamp not null,
  code varchar(50),
  location varchar(255),
  primary key (id));

CREATE TABLE dvd (
  id bigint auto_increment,
  title varchar(50) not null,
  actors varchar(200),
  format varchar(50),
  runtime int(10),
  location varchar(255),
  primary key (id));







